import * as React from 'react';
import Box from '@mui/material/Box';
import InputLabel from '@mui/material/InputLabel';
import MenuItem from '@mui/material/MenuItem';
import FormControl from '@mui/material/FormControl';
import Select from '@mui/material/Select';

function SelectApprove() {
    const [Approve, setApprove] = React.useState('');

    const handleChange = (event) => {
        setApprove(event.target.value);
    };
  return (
    <div>
 <Box sx={{ minWidth: 120,margin:'10px' }}>
      <FormControl fullWidth>
        <InputLabel id="demo-simple-select-label">รอการอนุมัติ</InputLabel>
        <Select
          labelId="demo-simple-select-label"
          id="demo-simple-select"
          value={Approve}
          onChange={handleChange}
        >
          <MenuItem value={10}>อนุมัติแล้ว</MenuItem>
          <MenuItem value={20}>ไม่ได้รับการอนุมัติ</MenuItem>
          <MenuItem value={30}>อนุมัติแล้ว</MenuItem>
        </Select>
      </FormControl>
    </Box>
    </div>
  )
}

export default SelectApprove
